INSERT INTO `products` VALUES (11,2,'Lịch Sử Do Thái','<p>Lịch sử Do Thái của Paul Johnson bắt đầu bằng những sự kiện được viết trong Kinh Thánh và kết thúc khi thành lập Nhà nước Israel. Cuốn sách không chỉ giới thiệu về lịch sử 4.000 năm tồn tại của người Do Thái mà còn đề cập đến những tác động, ảnh hưởng cũng như những đóng góp của họ cho nhân loại.&nbsp;<br>Người Do Thái tạo nên một bản sắc riêng biệt và cụ thể sớm hơn bất cứ dân tộc nào còn tồn tại tới ngày nay. Họ đã duy trì được nó giữa những nghịch cảnh khủng khiếp cho tới hôm nay. Sức chịu đựng phi thường này từ đâu ra? Sức mạnh ý chí đặc biệt cháy bỏng nào đã khiến người Do Thái khác biệt và giữ cho họ thuần nhất? Sức sống bền bỉ của họ nằm trong bản chất bất biến, hay khả năng thích ứng, hay cả hai? Liệu lịch sử của họ có cho thấy những nỗ lực như vậy là đáng giá? Hay nó cho thấy họ đã hoài công?<br>Những gì Paul Johnson đã tìm hiểu, nghiên cứu và thuật lại trên từng trang sách, sẽ phần nào giúp độc giả tự trả lời những câu hỏi này.<br>Ảnh bìa: Tranh trên bìa là một trang trong cuốn sách Mahzor của người Do Thái xuất bản ở Ba Lan năm 1913.&nbsp;<br>+TRÍCH ĐOẠN HAY:<br>\"Lịch sử người Do Thái có thể được mô tả như một chuỗi những đỉnh điểm và thảm họa nối tiếp nhau. Nó cũng có thể được coi là một miền liên tục không dứt của việc học hành kiên nhẫn, sự cần cù năng suất và thói quen tập thể mà phần lớn trong đó không được ghi lại. Nỗi buồn tìm thấy tiếng nói khi niềm vui câm lặng. Nhà sử học phải ghi nhớ điều này. Trải qua hơn 4.000 năm, người Do Thái chứng tỏ mình không chỉ là những người sống sót vĩ đại, mà còn đặc biệt khéo léo trong việc thích ứng với các xã hội nơi số phận xô đẩy họ, và trong việc tích lũy bất cứ tiện nghi nhân văn nào mà những xã hội này mang đến.\"<br>(Trích Phần bảy: Zion)&nbsp;<br>&nbsp;</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>','','data:image/jpeg;base64,',1,419000,32,'2020-02-02',1000,'Paul Johnson');
INSERT INTO `products` VALUES (12,2,'Đường Đến Thành Công Đỉnh Cao','<p>Sách tập hợp những tư tưởng cốt lõi đã dẫn đến thành công của 150 doanh nhân hàng đầu, cho bạn những lời khuyên hữu dụng và thú vị để đưa ra quyết định đột phá, cư xử đúng mực, phát triển sự nghiệp, lãnh đạo hiệu quả và nhiều điều khác nữa. Có lời khuyên là những yêu cầu đơn giản bạn nên theo, có lời khuyên là những đoản văn hấp dẫn, và có lời khuyên lại vạch ra những nguyên tắc dẫn đường; tất cả đều đắt giá, cung cấp nhiều kiến thức bổ ích và hữu dụng.</p><p>Quyển sách nên nằm trên kệ sách của bất kỳ doanh nhân thành công nào.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>','','data:image/jpeg;base64,',1,75000,37,'2017-11-03',1000,'Donald J. Trump - Meredith Mclver'),(13,2,'Napoleon - Nghệ Thuật Quân Sự Và Quyền Lực Đích Thực','<p>GIỚI THIỆU BỘ SÁCH: DELUXE BOOKS</p><p>Bộ sách Deluxe Books (Bộ sách Sang trọng) là bộ sách được biên soạn công phu kết hợp với hình ảnh mỹ thuật tuyệt đẹp do công ty xuất bản nổi tiếng Anh Quốc – Arcturus xuất bản nay đã được Tân Việt Books mua bản quyền và chuyển ngữ sang tiếng Việt. Bộ sách là những tác phẩm gốc của những vĩ nhân nổi tiếng trong lịch sử hoặc được các chuyên gia học giả uy tín hàng đầu chấp bút, soạn thảo. Phiên bản tiếng Việt lần này gồm năm cuốn bao gồm nhiều lĩnh vực như Chính trị, Nghệ thuật, Khoa học, Lịch sử, Văn hóa.</p><p><img src=\"https://salt.tikicdn.com/ts/tmp/f7/19/5b/ce30b179eb679c423fbc9ebf505ccf55.jpg\" alt=\"\"></p><p>Chủ đề về chính trị, quân sự</p><p>NAPOLEON - Nghệ thuật quân sự và quyền lực đích thực</p><p>Hành trình chinh phục quyền lực của Napoleon Bonaparte vô cùng thần tốc và kì diệu. Từng bị xem là kẻ ngoại đạo và một ngôi sao mới nổi với xuất phát điểm hết sức bình thường nhưng bằng sự quyết đoán, lòng quả cảm và chiến thuật điêu luyện, Napoleon đã trở thành nhà chỉ huy quân sự vĩ đại, kiệt suất nhất thời đại của mình. Ông được phong thiếu tướng ở tuổi 24, đăng cơ Hoàng đế Pháp ở tuổi 35 và chinh phạt hầu hết các quốc gia châu Âu khi mới 45 tuổi.</p><p><img src=\"https://salt.tikicdn.com/ts/tmp/af/98/da/59034452026b9ca1354facc7d12010ba.jpg\" alt=\"\"></p><p>Ấn bản này không chỉ tập hợp các phương châm của Napoleon về nghệ thuật quân sự trên chiến trường mà còn được minh họa vô cùng bắt mắt, giúp bạn đọc hiểu sâu sắc hơn về trí tuệ, trực giác và tài quân sự tháo vát, linh hoạt của vị đại tướng Pháp vô cùng đáng kính. Những tư tưởng của ông đã định hình nên quan điểm của nhiều thế hệ chiến lược gia quân sự, chính trị gia, doanh nhân, và vẫn còn nguyên giá trị cho đến ngày nay.</p><p><img src=\"https://salt.tikicdn.com/ts/tmp/11/60/64/053b040533d0d9e9ed08022d1f266fde.jpg\" alt=\"\"></p><p>Cuốn sách này là bản chuyển ngữ tiéng Anh do Đại tá, Sir George D’Aguilar thực hiện, xuất bản lần đầu vào năm 1831. Cuốn sách được viết lại dựa trên những tư liệu của Bá tước Emmanuel de La Cases – thư kí riêng của Napoleon trong thời gian bị lưu đày trên đảo Saint Helena. Tại các quốc gia nói tiếng Anh, bản dịch của Đại tá, Sir George D’Aguilar được lưu hành rộng rãi nhất.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>','','data:image/jpeg;base64,',1,265000,0,'2021-12-01',10000,'NAPOLEON');
INSERT INTO `products` VALUES (14,2,'Những Trí Tuệ Vĩ Đại - TESLA - Nhà Phát Minh, Cha Đẻ Của Dòng Điện Xoay Chiều','<p><strong>TESLA - Nhà phát minh, cha đẻ của dòng điện xoay chiều</strong></p><p>Được ca tụng là cha đẻ của dòng điện xoay chiều, Nikola Tesla đã làm thay đổi thế giới với các phát minh của mình. Nhà khoa học này đã cống hiến toàn bộ cuộc đời mình<br>cho việc nghiên cứu, khám phá, phát minh với hơn 700 bằng sáng chế thuộc về ông. Ngay từ thuở ấu thơ, tâm trí của Tesla đã tràn ngập những suy nghĩ thách thức khoa học, khi trưởng thành, ông phân tích những giải pháp, phát minh ở mức độ vô cùng chi tiết để lý giải chúng, đồng thời tự phát triển những nguyên lý, lý thuyết mới định hình lại tương lai của khoa học.</p><p>Từ tia X, ra-đa đến cuộn dây Tesla, radio, điều khiển từ xa, cuốn tiểu sử với 150 bức ảnh minh họa tuyệt đẹp này sẽ cho độc giả thấy được sự phát triển trong các lý thuyết<br>chính và phát minh của Tesla. Cuốn sách làm sáng tỏ những góc tối trong cuộc đời riêng tư và sự nghiệp của nhà phát minh đại tài, người đã sống một cuộc đời lập dị và cô độc, dù đã đóng góp đáng kể cho văn minh nhân loại. Tesla bao gồm những bức vẽ, lá thư, nhật kí, ghi chép hiếm hoi của Tesla, cùng với những bức ảnh chụp ông, tất cả tạo nên bức chân dung hoàn chỉnh về một trí tuệ vĩ đại trong lịch sử.</p><p>Thông tin tác giả:</p><p>Tiến sĩ Richard Gunderman là giáo sư ngành X-quang tại Đại học Indiana, Hoa Kỳ. Ông cũng từng là giáo sư thỉnh giảng, có các bài giảng được trích dẫn, cũng như những bài thuyết trình quan trọng tại hơn 500 học viện ở Hoa Kỳ và nước ngoài. Là tác giả của hơn 800 bài báo và 15 cuốn sách, tiến sĩ Richard Gunderman đã nhận vô số giải thưởng: 10 lần nhận được Giải thưởng Giảng dạy từ Hội đồng quản trị của Đại học Indiana, Giải thưởng Nhà giáo dục Truyền cảm hứng do Trường Đại học Y khoa Indiana lần đầu sáng lập vào năm 2015, danh hiệu Nhà giáo dục xuất sắc năm 2012 của Hiệp hội Tia Roentgen Hoa Kỳ. Năm 2012, ông nhận được Giải thưởng Alpha Omega Alpha Robert J. Glaser về Giảng dạy Xuất sắc, đây là giải thưởng giảng dạy hàng đầu do Hiệp hội các trường Cao đẳng Y khoa Hoa Kỳ trao tặng. Năm 2020, Hiệp hội các giáo sư ngành X-quang của trường Đại học đã trao tặng ông Huy chương Vàng.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>','','data:image/jpeg;base64,',1,299000,20,'2022-09-30',10000,'TESLA'),(15,2,'Tiểu Sử Steve Jobs','<p>Cuốn tiểu sử với tiêu đề ngắn gọn Steve Jobs do cựu thư ký tòa soạn của tạp chí Time, Walter Isaacson biên soạn, dựa trên 40 cuộc phỏng vấn với Steve Jobs trong 2 năm qua cùng các cuộc phỏng vấn với hơn 100 người thân, bạn bè, đồng nghiệp và đối thủ của ông, phát hành trên Amazon vào ngày 24/10 đang liên tục đứng vị trí số 1 danh sách sách bán chạy nhất của cả Amazon lẫn Barnes &amp; Nobles. Đây cũng là cuốn tiểu sử đầu tiên và duy nhất nhận được sự đồng ý của Steve Jobs. Walter Isaacson cũng là người viết tiểu sử nổi tiếng, với 2 tác phẩm viết về Benjamin Franklin và Albert Einstein.</p><p>Cuốn sách Tiểu Sử Steve Jobs tiết lộ nhiều thông tin chưa từng được kể về Steve Jobs như tính cách cay nghiệt, kỳ dị, chuyện ông chiến đấu với bệnh ung thư, những mối quan hệ lãng mạn của ông và cuộc hôn nhân với bà Laurene Powell hay gặp cha đẻ Abdulfattah \"John\" J Và trên hết đó là quá trình ông đã gây dựng và chèo lái Apple đi đến thành công như ngày hôm nay với không ít sai lầm cũng như những ám ảnh không thôi về sự hoàn hảo. Tác phẩm vì thế đã cung cấp cho người đọc một cái nhìn sâu sắc về nhân cách và cả những thành tựu của cuộc đời Steve Jobs. Đó là một cuốn sách chứa đựng những điều Steve Jobs muốn nói với thế giới.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>','','data:image/jpeg;base64,',1,260000,35,'2022-12-26',10000,'Walter Isaacson');
INSERT INTO `products` VALUES (16,2,'Chiến Lược Đầu Tư Của Warren Buffett','<p>Warren Buffett là một trong những nhà đầu tư giỏi nhất mọi thời đại. Nhưng chiến lược của ông là gì? Cuốn sách <strong>“</strong><i><strong>Chiến lược đầu tư của Warren Buffett</strong></i><strong>”</strong>sẽ dạy bạn khi nào Buffett mua và bán cổ phiếu, những gì ông ấy tìm kiếm khi nghiên cứu một cổ phiếu và những sai lầm lớn nhất mà người mới bắt đầu mắc phải khi cố gắng lặp lại chiến lược của mình.</p><p>Cuốn sách này không tập trung vào đầu tư đổi mới hoặc tạo ra một chiến lược mới mà chưa được chứng minh. Cuốn sách cũng sẽ không khám phá ra những ý tưởng mà thế giới chưa từng thấy. Nó sẽ không phát triển các lý thuyết về phân tích kỹ thuật và khám phá các mẫu biểu đồ chứng khoán. Tuy nhiên, cuốn sách này sử dụng các chiến lược đầu tư cơ bản đã và đang được sử dụng trong suốt thế kỷ qua.</p><p><i><strong>“Chiến lược đầu tư của Warren Buffett</strong></i><strong>”</strong>sẽ cung cấp cho bạn khuôn khổ 2 bước để chọn ra những loại cổ phiếu giúp bạn có thể vượt xa bạn bè mình. Có rất nhiều chiến lược đầu tư mà mọi người đã phát minh ra, tuy nhiên, bạn chỉ cần biết một chiến lược tuyệt vời để có thể thành công trên thị trường chứng khoán. Vì vậy, cuốn sách này có vẻ ngắn gọn và súc tích hơn những cuốn sách khác vì nó sẽ chỉ tập trung vào một chiến lược. Sẽ tốt hơn nhiều nếu có một chiến lược tuyệt vời mang lại lợi nhuận tốt, có thể dự đoán được mà không có rủi ro quá cao so với nhiều chiến lược tầm thường đôi khi có hiệu quả.</p><p>Cho dù bạn có nhiều tiền hay có rất ít, các nguyên tắc đầu tư không thay đổi. Bạn có khả năng kiểm soát tiền của mình và khiến cho tiền làm việc cho mình.</p><p>Sau khi đọc cuốn sách này, bạn sẽ có chiến lược 2 bước để chọn ra kẻ chiến thắng và tránh những kẻ thua cuộc. Bạn sẽ có quyền kiểm soát và sức mạnh đối với các khoản đầu tư của mình. Quan trọng nhất, bạn sẽ có sự rõ ràng. Bạn sẽ biết chính xác thời điểm mua và bán một cổ phiếu.</p><p>Nếu bạn có thể đưa ra những quyết định hợp lý, và nếu bạn có chiến lược đúng đắn, bạn sẽ trở thành một nhà đầu tư thành công.</p><p><i><strong>“Chiến lược đầu tư của Warren Buffett</strong></i><strong>”</strong>chỉ cung cấp cho bạn một chiến lược thị trường chứng khoán tuyệt vời mà đơn giản là chiến lược đầu tư tốt nhất vì nó mang lại lợi nhuận cao, có thể dự đoán được và rủi ro thấp. Chiến lược này đã được sử dụng bởi các nhà đầu tư giỏi nhất, và vẫn sẽ tiếp tục được sử dụng bởi họ. Nếu bạn muốn trở thành một trong số họ, đã đến lúc bạn bắt đầu thực hiện chiến lược 2 bước này!</p><p><strong>VỀ TÁC GIẢ</strong></p><p><strong>Danial Jiwani: </strong>anh đã dạy hơn 20.000 nhà đầu tư ở Mỹ, Canada và Anh về các nguyên tắc đầu tư, từng xuất hiện trên các tờ báo như <i>Chicago Tribune</i> và <i>MarketWatch</i>, trong các chương trình truyền hình như Off the Shelf.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>','','data:image/jpeg;base64,',1,169000,10,'2022-12-26',10000,'Danial Jiwani');
